import React from "react";

class SubjectsListContainer extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      subjects: [
        {
          id: "1",
          subject: "Математика",
          teacher: "проф. доктор хонорис кауза Стефани Кангалова",
          grade: 8
        }
      ]
    };
  }

  render() {
    return <div></div>;
  }
}

SubjectsListContainer.propTypes = {};

export default SubjectsListContainer;
